openapi: 3.1.0
info:
  title: Tableo API
  description: >-
    ## Prepare Your Environment:


    Change the url to the `Sandbox Url` for test


    **Production Url:**


    >
    [https://diary.bookia.eu/api/google-server/v3](https://diary.bookia.eu/api/google-server/v3)


    **Sandbox Url:**


    >
    [https://devrms.tableo.com/api/google-server/v3](https://devrms.tableo.com/api/google-server/v3)
  version: 1.0.0
servers:
  - url: http://{{url}}
  - url: https://app.tableo.com
  - url: https://hooks.slack.com
components:
  securitySchemes:
    basicAuth:
      type: http
      scheme: basic
    bearerAuth:
      type: http
      scheme: bearer
security:
  - basicAuth: []
tags:
  - name: google server
  - name: chatbot
  - name: stripe
  - name: freshworks
  - name: Agora
paths:
  /api/google-server/v3/merchants:
    get:
      tags:
        - google server
      summary: merchants
      description: |-
        This method returns all merchants.

        **Request**

        None

        **Return value**

        None.
